def op1Value =  (int)  (Math.random() * 1000)
def op2Value =  (int)  (Math.random() * 1000)
def res = (op1Value + op2Value)

testRunner.testCase.setPropertyValue( "operand1", op1Value.toString())
testRunner.testCase.setPropertyValue( "operand2", op2Value.toString() )
testRunner.testCase.setPropertyValue( "rightResult", res.toString() )

def resResp = Double.valueOf(testRunner.testCase.getPropertyValue( "resultFromResponse"))
def resRight = Double.valueOf (testRunner.testCase.getPropertyValue( "rightResult"))

assert resResp == resRight

